import { createStore } from "./redux/store"
import { nanoid } from 'nanoid'

function id() {
    return nanoid()
}
interface ITodo {
    text?: string,
    done?: boolean,
    id?: string
}
interface IAction<T> {
    type: string;
    payload?: Partial<T>;
}
const todoState: ITodo[] = [
    {
        text: 'Do homework',
        done: false,
        id: id()
    },
    {
        text: 'Make coffee',
        done: false,
        id: id()
    },
    {
        text: 'Make popop',
        done: false,
        id: id()
    }
]

enum todoActionTypes {
    ADD_TODO = 'ADD_TODO',
    REMOVE_TODO = 'REMOVE_TODO',
    SET_TODO = 'SET_TODO'
}


function todoReducer(state: ITodo[], action: IAction<ITodo>) {
    switch (action.type) {
        case 'ADD_TODO':
            state.push({
                ...action.payload,
                done: false,
                id: id(),
            });
            return state
        case 'REMOVE_TODO':
            const filterState = state.filter(todo => action.payload?.id !== todo.id)
            return filterState
        case 'SET_TODO':
            const newState = state.map((todo) => (
                todo.id === action.payload?.id
                    ? { ...todo, done: !todo.done }
                    : todo
            ));
            return newState
        default:
            return state
    }
}

const store = createStore(todoReducer, todoState)

const todo = document.querySelector('.todo') as HTMLElement;

function updateTodo() {
    let storage = store.getState();
    todo.innerHTML = '';
    storage.map(y => todo.innerHTML += `<div class="todo__element" ><p id="${y.id}" data-done="${y.done}" class="todo__item">${y.text}</p><i id="${y.id}" class='bx bx-trash'></i></div>`)
    const todosText = document.querySelectorAll('.todo__item');
    for (let k of todosText) {
        k.addEventListener('click', (e) => {
            // let idK: string = String(k.id);
            store.dispatch({
                type: 'SET_TODO',
                payload: {
                    id: e.target.id
                }
            })
        })
    }
    let todoDelete = document.querySelectorAll('.bx-trash');
    for (let k of todoDelete) {
        k.addEventListener('click', (e) => {
            store.dispatch({
                type: 'REMOVE_TODO',
                payload: {
                    id: k.id
                }
            })
        })
    }
}
updateTodo()
store.subscribe(updateTodo)

const buttonAddTodo = document.querySelector('.add');
buttonAddTodo?.addEventListener('click', () => {
    let input = document.querySelector('.input') as HTMLInputElement;
    if (input.value !== '') {
        const value: string = String(input.value);
        store.dispatch({
            type: "ADD_TODO",
            payload: {
                text: value
            }
        })
        input.value = "";
    }
})

const showState = document.querySelector('.state');
showState?.addEventListener('click', () => {
    const state = store.getState();
    console.log(state)
})






